import React from "react"
import Head from "./Head.js"
import ChooseMenu from "./ChooseMenu.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import { Collapse ,Container, Row,Col,Nav,Tab,Tabs} from "react-bootstrap";


class App extends React.Component {
  constructor(props){
    super(props)
    this.state={
      homemenustart:false,
      homemenu:false,
      wait:""
    }
  }
  sethomemenu(event){
    this.setState({wait:500})
    this.setState({homemenu:event}) 
    this.space(event);
  }
  space(event){
    if(event){
      setTimeout(function() {
        this.setState({homemenustart:event})
      }.bind(this), 200);  
    }    
  }
  render() {
    return (
      <div className="text-center bg-dark">
        <div className="APPbackground">
          <Container className="mb-auto">
            <Row>
              <Col className="md-2 mb-3 mb-md-auto h3 header-brand">Numer</Col>
              <Col>
              <Tabs defaultActiveKey="Home" >
                <Tab  eventKey="Home" title="Home">
                    <div>
                    <div className="center APPtexthead APPtexthead2"><div className="APPtexthead1">
                        <b>NUMERIC</b>
                        </div><br/><div>ระเบิดเวลา ฮ้าาาาาา เริ่มเดินมาตั้งแต่น้องพบเขา
                        <br/>เจ้าถ่ายโอนในความเป็นเรา ยกให้เขาทีละน้อย อ้ายวิ่งไขว่คว้าตามใจเจ้าคืน
                        <br/>น้องกะบืนหนีใส่เกียร์ถอย ได้แต่มองฮักที่หลุดลอย รอถึงวันเลิกรา</div>
                    </div>
                    <div className="homemenutop"/>
                    </div>
                  </Tab> 
                  <Tab  eventKey="Home2" title="Home2">
                    <ChooseMenu/>
                  </Tab>
                </Tabs>
              </Col>
            </Row>
          </Container>
        </div>
        <footer className="footer center">
          <div>Made By <a href="https://www.facebook.com/title.tawan" target="_self">Title Tawan.</a></div >
        </footer>
      </div>
    )
  }
}

export default App;
